import "./navbar.css";
import NavElements from "./navbar-elements";
function Navbar(){
  const navigation=[
    {
      first:"About"
    },
    {
      first:"Games"
    },
    {
      first:"Amazon UK"
    },
    {
      first:"Amazon USA"
    },
    {
      first:"Socials"
    },
  ]
  return(
    <div>
        <div className="nav-first-group">
            <h1 className="navbar-title">Lucky<span>Egg</span></h1>
            <p className="navbar-para">Games are more<br></br> than Fun</p>
            <div className="nav-ele-group">
            <NavElements nav={navigation[0].first}></NavElements>
            <NavElements nav={navigation[1].first}></NavElements>
            <NavElements nav={navigation[2].first}></NavElements>
            <NavElements nav={navigation[3].first}></NavElements>
            <NavElements nav={navigation[4].first}></NavElements>
            </div>
            
        </div>
    </div>
  )
}
export default Navbar
